import React, { useEffect, useState } from 'react';
import './styles/Checklist.css';
import jsPDF from 'jspdf';

const Checklist = () => {
  const [checkedItems, setCheckedItems] = useState(() => {
    const saved = localStorage.getItem('checkedItems');
    return saved ? JSON.parse(saved) : [];
  });

  const [progressHistory, setProgressHistory] = useState(() => {
    const savedHistory = localStorage.getItem('progressHistory');
    return savedHistory ? JSON.parse(savedHistory) : [];
  });

  const [reminder, setReminder] = useState('');

  const checklistItems = [
    { text: "Use semantic HTML", tip: "Semantic HTML helps search engines and assistive technologies understand your content." },
    { text: "Provide alt text for images", tip: "Alt text ensures that visually impaired users can access image content." },
    { text: "Ensure keyboard navigation", tip: "Keyboard navigation is essential for users who cannot use a mouse." },
    { text: "Use sufficient color contrast", tip: "Good color contrast makes text readable for users with visual impairments." },
    { text: "Implement ARIA roles where necessary", tip: "ARIA roles provide additional context to assistive technologies." },
  ];

  const handleCheck = (item) => {
    const updatedItems = checkedItems.includes(item)
      ? checkedItems.filter(i => i !== item)
      : [...checkedItems, item];

    setCheckedItems(updatedItems);

    // Update progress history
    setProgressHistory(prevHistory => [
      ...prevHistory,
      { date: new Date().toLocaleString(), items: updatedItems }
    ]);
  };

  useEffect(() => {
    localStorage.setItem('checkedItems', JSON.stringify(checkedItems));
    localStorage.setItem('progressHistory', JSON.stringify(progressHistory));
  }, [checkedItems, progressHistory]);

  const completionPercentage = Math.round((checkedItems.length / checklistItems.length) * 100);

  const handleShare = () => {
    const checklistData = JSON.stringify(checkedItems);
    const shareableLink = `${window.location.origin}/?data=${encodeURIComponent(checklistData)}`;
    navigator.clipboard.writeText(shareableLink);
    alert("Shareable link copied to clipboard!");
  };

  const handleExportPDF = () => {
    const doc = new jsPDF();
    doc.text("Accessibility Checklist", 20, 20);
    checklistItems.forEach((item, index) => {
      const status = checkedItems.includes(item.text) ? "✔️" : "❌";
      doc.text(`${status} ${item.text}`, 20, 30 + (index * 10));
    });
    doc.save("checklist.pdf");
  };

  const handleSetReminder = () => {
    alert(`Reminder set for: ${reminder}`);
    setReminder('');
  };

  return (
    <section className="checklist-section">
      <h2>Accessibility Checklist</h2>
      <div className="progress-bar">
        <div className="progress" style={{ width: `${completionPercentage}%` }} />
      </div>
      <p className="completion-text">{completionPercentage}% Completed</p>
      <ul className="checklist">
        {checklistItems.map(item => (
          <li key={item.text} className={checkedItems.includes(item.text) ? 'checked' : ''}>
            <label>
              <input
                type="checkbox"
                checked={checkedItems.includes(item.text)}
                onChange={() => handleCheck(item.text)}
              />
              <span className="checkmark"></span>
              {item.text}
              <span className="tooltip">{item.tip}</span>
            </label>
          </li>
        ))}
      </ul>
      <button onClick={handleShare} className="share-button">Share Checklist</button>
      <button onClick={handleExportPDF} className="export-button">Export to PDF</button>
      <div className="reminder-section">
        <input
          type="text"
          value={reminder}
          onChange={(e) => setReminder(e.target.value)}
          placeholder="Set a reminder..."
        />
        <button onClick={handleSetReminder} className="set-reminder-button">Set Reminder</button>
      </div>
      <div className="history-section">
        <h3>Progress History</h3>
        <ul>
          {progressHistory.map((entry, index) => (
            <li key={index}>{entry.date}: {entry.items.join(', ')}</li>
          ))}
        </ul>
      </div>
    </section>
  );
};

export default Checklist;
